Comments.Message:
I fixed this problem by changing the recursion to a queue/stack behaviour. HtmlAgilityPack still seems to work fine after my patch, but no guarantees :)

internal void CloseNode(HtmlNode _endnode)
{
	Stack<KeyValuePair<HtmlNode, HtmlNode>> nodesToClose = new Stack<KeyValuePair<HtmlNode, HtmlNode>>();
	nodesToClose.Push(new KeyValuePair<HtmlNode,HtmlNode>(this, _endnode));

	while (nodesToClose.Count > 0)
	{
		var kvp = nodesToClose.Pop();
		HtmlNode node = kvp.Key;
		HtmlNode endnode = kvp.Value;

		if (!node._ownerdocument.OptionAutoCloseOnEnd)
		{
			// close all children
			if (node._childnodes != null)
			{
				foreach (HtmlNode child in node._childnodes)
				{
					if (child.Closed)
						continue;

					// create a fake closer node
					HtmlNode close = new HtmlNode(node.NodeType, node._ownerdocument, -1);
					close._endnode = close;
					//child.CloseNode(close);
					nodesToClose.Push(new KeyValuePair<HtmlNode, HtmlNode>(child, close));
				}
			}
		}
		
		if (!node.Closed)
		{
			node._endnode = endnode;

			if (node._ownerdocument._openednodes != null)
			{
				node._ownerdocument._openednodes.Remove(node._outerstartindex);
			}

			HtmlNode self = node._ownerdocument._lastnodes[node.Name] as HtmlNode;
			if (self == node)
			{
				node._ownerdocument._lastnodes.Remove(node.Name);
				node._ownerdocument.UpdateLastParentNode();
			}

			if (endnode == node)
				return;

			// create an inner section
			node._innerstartindex = node._outerstartindex + node._outerlength;
			node._innerlength = endnode._outerstartindex - node._innerstartindex;

			// update full length
			node._outerlength = (endnode._outerstartindex + endnode._outerlength) - node._outerstartindex;
		}
	}
}
